import React from 'react';
import ReactDOM from 'react-dom';

export class App1 extends React.Component {
    render() {
        return (
            <div>
                <h1>Chrisantus Eze</h1>
                <p>This is a short publication about Chrisantus Eze</p>
            </div>
        );
    }
}
